import NavBar from './Components/NavBar'
import News from './Components/News'
import {BrowserRouter as Router,
  Route,
  } from 'react-router-dom'
export class App extends Component {
  render() {
    return (
      <Router>
        <div>

      <Route path="/about">
      <NavBar />
      </Route>
      <Route path="/users">
      <News pageSize={9} category='health' country='us' />
      </Route>

  </div>
</Router>


    )
  }
}

export default App
